import React from "react";

const FaceRecognition = ({imageUrl}) => {
    return(  
        <div className="center">
            <div className="absolute mt2">
                <img id='inputImage' src={imageUrl} alt="" style={{width:'500px', height: 'auto'}} />
            </div>
        </div>  
    );
}

export default FaceRecognition;
